import React from 'react';

// import components
import Tweet from '../Components/Tweet';
import NewTweet from '../Components/NewTweet';


function Main () {
    return (
        <main>
            {/* search */ }
            <input
                id="searchInput"
                placeholder="Filter tweets"
            >
            </input>
            {/* new tweet */ }
            <NewTweet />
            {/* map - container of tweets */ }
            <div id="tweetsList">
                <Tweet />
            </div>
        </main>
    );
}

export default Main;
